import React from 'react';
import WorldMap from 'react-world-map';

const Map = () => {
    return (
        <WorldMap />
    )
}

window.addEventListener(
    'WorldMapClicked',
    function(e) {
        console.log('map was clicked, current selection is: ', e.detail.clickedState)
    }
);

export default Map
